import React from 'react';


export const CarList = () => {
    const carData =["Dog", "Bird", "Cat", "Mouse", "Horse"]; 
  return (
    <div>
        <ul>
            {carData.map(carName => (
                <li>{carName}</li>
            ))}
        </ul>
    </div>
  )
}
